import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';

// 订单查询
const DeviceStanding = Loadable({
  loader: () => import('layouts/DeviceManage/DeviceStanding'),
  loading: LoadingComponent
});
// 运维日志
const DeviceDaily = Loadable({
  loader: () => import('layouts/DeviceManage/DailyPage'),
  loading: LoadingComponent
});
// 运维工单
const DeviceWork = Loadable({
  loader: () => import('layouts/WorkManage'),
  loading: LoadingComponent
});

export {
  DeviceStanding,DeviceDaily,DeviceWork
};
